import React, { useState } from 'react';


export default function AddPet() {
  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label htmlFor="type">Type:</label>
        <input type="text" name="type" value={formData.type} onChange={handleInputChange} />
      </div>
      <div>
        <label htmlFor="name">Name:</label>
        <input type="text" name="name" value={formData.name} onChange={handleInputChange} />
      </div>
      <div>
        <label htmlFor="height">Height:</label>
        <input type="text" name="height" value={formData.height} onChange={handleInputChange} />
      </div>
      <div>
        <label htmlFor="weight">Weight:</label>
        <input type="text" name="weight" value={formData.weight} onChange={handleInputChange} />
      </div>
      <div>
        <label htmlFor="color">Color:</label>
        <input type="text" name="color" value={formData.color} onChange={handleInputChange} />
      </div>
      <div>
        <label htmlFor="bio">Bio:</label>
        <textarea name="bio" value={formData.bio} onChange={handleInputChange} />
      </div>
      <div>
        <label htmlFor="age">Age:</label>
        <input type="number" name="age" value={formData.age} onChange={handleInputChange} />
      </div>
      <div>
        <label htmlFor="hypoallergenic">Hypoallergenic:</label>
        <input type="checkbox" name="hypoallergenic" checked={formData.hypoallergenic} onChange={handleInputChange} />
      </div>
      <div>
        <label htmlFor="dietary_restrictions">Dietary Restrictions:</label>
        <input type="text" name="dietary_restrictions" value={formData.dietary_restrictions} onChange={handleInputChange} />
      </div>
      <div>
        <label htmlFor="breed">Breed:</label>
        <input type="text" name="breed" value={formData.breed} onChange={handleInputChange} />
      </div>
      <button type="submit">Add Pet</button>
     </form>
  )
}


